Input: Where was the chicken First domesticated?  Choices: a) France b) India c) Peru d) Zaire 
 Output:
 First, I need to find out where the chicken was first domesticated. Chickens were domesticated in several regions, but the earliest evidence comes from India. Archaeological findings suggest that chickens were domesticated in India around 5,000 years ago. Therefore, the correct answer is {'sol': 'b'}

Input: Which of the following steps should be taken first to effectively present new information to coworkers?  Choices: a) Analyzing the audience b) Determining the objective c) Creating three to five key messages d) Choosing a communication tool 
 Output:
 First, I need to determine the objective of the presentation. This step is crucial because it sets the purpose and direction of the entire presentation. Without a clear objective, it would be difficult to effectively present new information to coworkers. Therefore, the correct answer is {'sol': 'b'}

Input: A committee of middle school teachers is meeting to begin the process of finding a software program to improve students' drafting skills.  Which of the following steps should the committee take first in the process?  Choices: a) Downloading a trial version of the most popular software for evaluation b) Conducting a survey to determine the importance of drafting skills in the classroom c) Defining the learning objectives they would like the software to meet d) Deciding what type of user interface would be most appropriate 
 Output:
 First,  the committee needs to understand what they want to achieve with the software.  They need to define the learning objectives they would like the software to meet.  This will help guide the rest of the decision-making process.  Therefore,  the correct answer is {'sol': 'c'}
